import React from "react";
import BookItem from "./BookItem";
import bookData from '../bookData.json';

const List = (props) => {

    return (
        <ul>
            {props.items.map((book) => (
                <BookItem
                    key={book.id}
                    title={book.title}
                    author={book.author}
                    publicationDate={book.publicationDate}
                    genre={book.genre} 
                />
            ))}
        </ul>
    );
}

export default List;
